import * as style from "../../css/light/focusedList"

export default function FocusedDeviceList(props) {
  console.log(props.meta)
  const renderFocusedDeviceItem = list => {
    if (list) {
      return list.map((item, i) => (
        <div key={`user${i}`}>{item}</div>
      ))  
    }
    else return (<div></div>)
  }

  return props.profile['lines'].map((item, i) => (
    <div style={style.focusContentContainer}>
      <div style={{display: "flex"}}>
        {/* <div style={{width: "29.5vw"}}>{item}
          <div style={{...style.divider, margin: "3px 0px 2px 30px", width: "26vw"}}></div>
          {renderFocusedDeviceItem(i)}
        </div> */}
        <div style={{width: "14.55vw"}}>Lines
          <div style={{...style.divider, margin: "3px 0px 2px 30px", width: "11.5vw"}}></div>
          {renderFocusedDeviceItem(props.profile['lines'][i])}
        </div>
        <div style={{width: "14.2vw"}}>BLF
          <div style={{...style.divider, margin: "3px 0px 2px 26px", width: "11.5vw"}}></div>
           {renderFocusedDeviceItem(props.profile['blfs'][i])}
        </div>
      </div>
    </div>
  ))
}
